import{_ as t,a as e,b as a,c as o}from"./chunks/img_6.01f9fb90.js";import{_ as i,o as s,c as r,O as n}from"./chunks/framework.4afe7240.js";const c="/assets/img_1.1dd700ea.png",l="/assets/img_2.eaf8a723.png",p="/assets/img_3.591b3a9f.png",g="/assets/img_4.a02d2a90.png",u="/assets/img_5.d114aef5.png",m="/assets/img_6.bda0d18c.png",d="/assets/img_7.aff48dd8.png",h="/assets/img_8.c0a24327.png",b="/assets/img_9.33ec6e55.png",_="/assets/img_10.ff1331c4.png",k="/assets/img_11.5cd7d3e0.png",y=JSON.parse('{"title":"图床配置","description":"","frontmatter":{},"headers":[{"level":2,"title":"GitHub Token","slug":"github-token","link":"#github-token","children":[]},{"level":2,"title":"绑定仓库","slug":"绑定仓库","link":"#绑定仓库","children":[]},{"level":2,"title":"绑定分支","slug":"绑定分支","link":"#绑定分支","children":[]},{"level":2,"title":"绑定目录","slug":"绑定目录","link":"#绑定目录","children":[]}],"relativePath":"usage-guide/config.md","filePath":"usage-guide/config.md","lastUpdated":1686217894000}'),f={name:"usage-guide/config.md"},q=n('<h1 id="图床配置" tabindex="-1">图床配置 <a class="header-anchor" href="#图床配置" aria-label="Permalink to &quot;图床配置&quot;">​</a></h1><p><a href="https://picx.xpoet.cn" target="_blank" rel="noreferrer">PicX</a> 的图床服务依托于 GitHub，在上传图片之前，你需要先使用 GitHub Token 来完成 <strong>仓库</strong>、<strong>分支</strong> 和 <strong>目录</strong> 之间的绑定。</p><blockquote><ul><li>仓库 - 托管图片的图床</li><li>目录 - 存放图片的文件夹</li></ul></blockquote><h2 id="github-token" tabindex="-1">GitHub Token <a class="header-anchor" href="#github-token" aria-label="Permalink to &quot;GitHub Token&quot;">​</a></h2><p>PicX 基于 GitHub API 实现图片的上传、删除和管理，你必须拥有一个 GitHub Token，才能获得 PicX 的图床服务。</p><h3 id="获取-github-token" tabindex="-1">获取 GitHub Token <a class="header-anchor" href="#获取-github-token" aria-label="Permalink to &quot;获取 GitHub Token&quot;">​</a></h3><p><strong><a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">创建</a></strong> 一个带有 <code>repo</code> 权限的 GitHub Token。</p><blockquote><p>点击 <a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">https://github.com/settings/tokens/new</a> 快速新建 GitHub Token</p></blockquote><p><img src="'+t+'" alt="image"></p><p>点击 <strong><code>Generate token</code></strong> 按钮，生成 GitHub Token。</p><p><img src="'+e+'" alt="image"></p><p><img src="'+a+'" alt="image"></p><div class="danger custom-block"><p class="custom-block-title">注意</p><p><strong>新生成的 Token 只会显示一次，请妥善保存，如有遗失，重新生成即可。</strong></p></div><h3 id="绑定-github-token" tabindex="-1">绑定 GitHub Token <a class="header-anchor" href="#绑定-github-token" aria-label="Permalink to &quot;绑定 GitHub Token&quot;">​</a></h3><p>通过 GitHub Token 可以获取到你的 GitHub 用户信息、Public 仓库信息等数据。</p><p><img src="'+c+'" alt="image"></p><p><img src="'+l+'" alt="image"></p><h2 id="绑定仓库" tabindex="-1">绑定仓库 <a class="header-anchor" href="#绑定仓库" aria-label="Permalink to &quot;绑定仓库&quot;">​</a></h2><p>在 PicX 中，GitHub 仓库就是图床，上传的所有图片都存储在仓库里，你可以使用一个已有的仓库，也可以新建一个仓库专门用作图床（推荐）。</p><blockquote><p>推荐使用 <strong><code>一键自动配置</code></strong>，自动创建仓库并完成仓库、分支和目录之间的绑定。</p></blockquote><h3 id="新建仓库" tabindex="-1">新建仓库 <a class="header-anchor" href="#新建仓库" aria-label="Permalink to &quot;新建仓库&quot;">​</a></h3><p><strong><a href="https://github.com/new" target="_blank" rel="noreferrer">创建</a></strong> 一个用来存储图片的 GitHub 仓库，仓库类型必须选 <code>Public</code> 。</p><blockquote><p>点击链接 <a href="https://github.com/new" target="_blank" rel="noreferrer">https://github.com/new</a> 快速新建仓库</p></blockquote><p><img src="'+p+'" alt="image"></p><h3 id="选择仓库" tabindex="-1">选择仓库 <a class="header-anchor" href="#选择仓库" aria-label="Permalink to &quot;选择仓库&quot;">​</a></h3><p>在选择仓库的下拉列表中，选择刚刚新建的仓库作为图床。</p><p><img src="'+g+'" alt="image"></p><h2 id="绑定分支" tabindex="-1">绑定分支 <a class="header-anchor" href="#绑定分支" aria-label="Permalink to &quot;绑定分支&quot;">​</a></h2><p>如果你绑定的仓库有多个分支，则会出现选择分支的下拉列表，选择其中一个即可。</p><p><img src="'+u+'" alt="image"></p><p>暂时不支持通过 PicX 来给 GitHub 仓库新建分支，如果你想要多个分支，必须手动去创建。</p><p>然而，PicX 支持创建多级目录，多分支可有可无，如果你不熟悉 GitHub 仓库的分支创建，完全可以忽略这一步。</p><h2 id="绑定目录" tabindex="-1">绑定目录 <a class="header-anchor" href="#绑定目录" aria-label="Permalink to &quot;绑定目录&quot;">​</a></h2><p>在 PicX 中，目录是指仓库里存放图片的文件夹，上传图片之前，需绑定一个目录。</p><p><img src="'+m+'" alt="image"></p><ul><li><p>新建目录：手动输入一个新目录，图片上传时会自动创建。</p><p><img src="'+d+'" alt="image"></p><blockquote><p>使用 <code>/</code> 可以创建多级目录，最大支持 5 级。<br> 例如：<code>x01/x02/x03</code>，表示创建到了 3 级目录。</p></blockquote></li><li><p>根目录：图片将存储在仓库根目录下。</p><p><img src="'+h+'" alt="image"></p></li><li><p>自动目录：自动生成日期格式 <code>yyyyMMdd</code> 的目录名，例如：<code>20230605</code>。</p><p><img src="'+b+'" alt="image"></p></li><li><p>仓库目录</p><p>如果你绑定的仓库和分支下面存在多个目录，选择其中一个即可。</p><p><img src="'+_+'" alt="image"></p></li></ul><p>至此，完成手动配置图床，点击 <strong><code>确定</code></strong> 按钮即可跳转到上传图片。</p><p><img src="'+k+'" alt="image"></p><p><img src="'+o+'" alt="image"></p>',39),P=[q];function G(H,T,x,v,X,w){return s(),r("div",null,P)}const A=i(f,[["render",G]]);export{y as __pageData,A as default};
